export const PageFooter = () => {
    return (
        <>
            <div className='footer-container'>
                <p className='footer' >Desenvolvido por <a href="https://arthurviniciusl.github.io/arthur-vs-lucena/" target="_blank" rel="noopener noreferrer">Arthur Vinicius</a></p>
            </div>
        </>
    );
}
